import React, { useState, useEffect } from 'react';
import styled from 'styled-components';
import SearchBar from '../components/SearchBar';
import PropertyCard from '../components/PropertyCard';

const PageHeader = styled.div`
  background: #1e293b;
  color: white;
  padding: 6rem 2rem 4rem;
  margin-top: 70px;
  text-align: center;
`;

const Container = styled.div`
  max-width: 1200px;
  margin: 0 auto;
  padding: 0 2rem;
`;

const PropertyGrid = styled.div`
  display: grid;
  grid-template-columns: repeat(auto-fit, minmax(300px, 1fr));
  gap: 2rem;
  margin-top: 2rem;
`;

const FilterSection = styled.div`
  background: #f8fafc;
  padding: 2rem 0;
`;

const SortControls = styled.div`
  display: flex;
  justify-content: space-between;
  align-items: center;
  margin-bottom: 2rem;
  flex-wrap: wrap;
  gap: 1rem;
`;

const ResultsCount = styled.div`
  color: #64748b;
  font-weight: 500;
`;

const SortSelect = styled.select`
  padding: 0.5rem 1rem;
  border: 1px solid #d1d5db;
  border-radius: 6px;
  background: white;
`;

const NoResults = styled.div`
  text-align: center;
  padding: 4rem 2rem;
  color: #64748b;

  h3 {
    font-size: 1.5rem;
    margin-bottom: 1rem;
    color: #374151;
  }
`;

// Extended property data
const allProperties = [
  {
    id: 1,
    title: "Modern Downtown Condo",
    location: "Downtown, Seattle",
    price: 750000,
    type: "sale",
    bedrooms: 2,
    bathrooms: 2,
    sqft: 1200,
    image: "https://images.unsplash.com/photo-1545324418-cc1a3fa10c00?w=400"
  },
  {
    id: 2,
    title: "Luxury Family Home",
    location: "Bellevue, WA",
    price: 1250000,
    type: "sale",
    bedrooms: 4,
    bathrooms: 3,
    sqft: 2800,
    image: "https://images.unsplash.com/photo-1570129477492-45c003edd2be?w=400"
  },
  {
    id: 3,
    title: "Cozy Studio Apartment",
    location: "Capitol Hill, Seattle",
    price: 2200,
    type: "rent",
    bedrooms: 1,
    bathrooms: 1,
    sqft: 600,
    image: "https://images.unsplash.com/photo-1522708323590-d24dbb6b0267?w=400"
  },
  {
    id: 4,
    title: "Spacious Townhouse",
    location: "Kirkland, WA",
    price: 950000,
    type: "sale",
    bedrooms: 3,
    bathrooms: 2,
    sqft: 1800,
    image: "https://images.unsplash.com/photo-1568605114967-8130f3a36994?w=400"
  },
  {
    id: 5,
    title: "Waterfront Penthouse",
    location: "Belltown, Seattle",
    price: 4500,
    type: "rent",
    bedrooms: 3,
    bathrooms: 2,
    sqft: 2200,
    image: "https://images.unsplash.com/photo-1502672260266-1c1ef2d93688?w=400"
  },
  {
    id: 6,
    title: "Charming Craftsman Home",
    location: "Fremont, Seattle",
    price: 850000,
    type: "sale",
    bedrooms: 3,
    bathrooms: 2,
    sqft: 1600,
    image: "https://images.unsplash.com/photo-1518780664697-55e3ad937233?w=400"
  },
  {
    id: 7,
    title: "Modern Loft Apartment",
    location: "South Lake Union, Seattle",
    price: 3200,
    type: "rent",
    bedrooms: 2,
    bathrooms: 1,
    sqft: 1100,
    image: "https://images.unsplash.com/photo-1484154218962-a197022b5858?w=400"
  },
  {
    id: 8,
    title: "Executive Estate",
    location: "Medina, WA",
    price: 2500000,
    type: "sale",
    bedrooms: 5,
    bathrooms: 4,
    sqft: 4200,
    image: "https://images.unsplash.com/photo-1613977257363-707ba9348227?w=400"
  }
];

const Listings = () => {
  const [properties, setProperties] = useState(allProperties);
  const [sortBy, setSortBy] = useState('price-low');
  const [filteredProperties, setFilteredProperties] = useState(allProperties);

  const handleSearch = (filters) => {
    let filtered = allProperties.filter(property => {
      if (filters.location && !property.location.toLowerCase().includes(filters.location.toLowerCase())) {
        return false;
      }
      if (filters.type && property.type !== filters.type) {
        return false;
      }
      if (filters.minPrice && property.price < parseInt(filters.minPrice)) {
        return false;
      }
      if (filters.maxPrice && property.price > parseInt(filters.maxPrice)) {
        return false;
      }
      if (filters.bedrooms && property.bedrooms < parseInt(filters.bedrooms)) {
        return false;
      }
      return true;
    });
    setFilteredProperties(filtered);
  };

  const handleSort = (value) => {
    setSortBy(value);
    let sorted = [...filteredProperties];

    switch(value) {
      case 'price-low':
        sorted.sort((a, b) => a.price - b.price);
        break;
      case 'price-high':
        sorted.sort((a, b) => b.price - a.price);
        break;
      case 'sqft-high':
        sorted.sort((a, b) => b.sqft - a.sqft);
        break;
      case 'bedrooms-high':
        sorted.sort((a, b) => b.bedrooms - a.bedrooms);
        break;
      default:
        break;
    }

    setFilteredProperties(sorted);
  };

  useEffect(() => {
    handleSort(sortBy);
  }, []);

  return (
    <div>
      <PageHeader>
        <Container>
          <h1 style={{ fontSize: '2.5rem', fontWeight: '700', marginBottom: '1rem' }}>
            Property Listings
          </h1>
          <p style={{ fontSize: '1.1rem', opacity: '0.9' }}>
            Discover your perfect property from our extensive collection
          </p>
        </Container>
      </PageHeader>

      <FilterSection>
        <Container>
          <SearchBar onSearch={handleSearch} />
        </Container>
      </FilterSection>

      <Container style={{ padding: '2rem' }}>
        <SortControls>
          <ResultsCount>
            {filteredProperties.length} properties found
          </ResultsCount>
          <div style={{ display: 'flex', alignItems: 'center', gap: '1rem' }}>
            <span style={{ color: '#374151', fontWeight: '500' }}>Sort by:</span>
            <SortSelect 
              value={sortBy} 
              onChange={(e) => handleSort(e.target.value)}
            >
              <option value="price-low">Price: Low to High</option>
              <option value="price-high">Price: High to Low</option>
              <option value="sqft-high">Square Feet: Largest</option>
              <option value="bedrooms-high">Bedrooms: Most</option>
            </SortSelect>
          </div>
        </SortControls>

        {filteredProperties.length > 0 ? (
          <PropertyGrid>
            {filteredProperties.map(property => (
              <PropertyCard key={property.id} property={property} />
            ))}
          </PropertyGrid>
        ) : (
          <NoResults>
            <h3>No properties found</h3>
            <p>Try adjusting your search criteria to find more properties.</p>
          </NoResults>
        )}
      </Container>
    </div>
  );
};

export default Listings;
